import React from 'react'

export default function ShowSavingGoal({dbChildren}) {
    console.log("dbChildren in ShowSavingGoal", dbChildren.children);
    return (
        <div>
            <i>ShowSavingGoal</i>
            <h3>{dbChildren.children.goalTitle}</h3>
            <img src={dbChildren.children.goalPic} alt={dbChildren.children.goalTitle} id="goalPic"></img>


        </div>
    )
}
